@NikolayPianikov, is `HelloWorld.Tests.dll` compiled as a .NET 4.5 assembly? If it is, then the error is correct. 

If NUnit 2.6.4 is detecting that the assembly is 4.5 and running it as 4.5 despite the fact that you specified 4.0, then I think that is wrong.

If however HelloWorld.Tests.dll targets .NET 4.0 or earlier, then this is a bug. Can you please confirm which framework it targets?
